<script setup>
import { onMounted, reactive } from 'vue'

defineProps({
  height: {
    type: Number,
    default: 300
  },
  workspace: {
    type: Object,
    default: null
  }
})

const NAV = reactive({
  187: { act: 'zoom', dir: 1, name: 'in' },
  189: { act: 'zoom', dir: -1, name: 'out' },
  37: { act: 'move', dir: -1, name: 'left', axis: 0 },
  38: { act: 'move', dir: -1, name: 'up', axis: 0 },
  39: { act: 'move', dir: 1, name: 'right', axis: 0 },
  40: { act: 'move', dir: 1, name: 'down', axis: 0 }
})

const settings = reactive({
  _SVG: null,
  _VB: null,
  _DMAX: null,
  _WMIN: 8,
  _NF: 32
})

onMounted(() => {
  _initSVG()
})

const onMouseOver = (e) => {
  console.log('onMouseOver', e?.target?.id)
}

const _initSVG = () => {
  window.addEventListener('keyup', (e) => _NAVIGATE(e))
}

const _NAVIGATE = (e) => {
  const _svg = document.querySelector('svg')
  const _VB = _svg.getAttribute('viewBox').split(' ').map((x) => +x),
    DMAX = _VB.slice(2), WMIN = 8, NF = 32

  settings._SVG = _svg
  settings._VB = _VB
  settings._DMAX = DMAX
  settings._WMIN = WMIN
  settings._NF = NF

  // console.log('event', e.keyCode)
  let navi = null
  const tg = Array(4)
  if (e.keyCode in NAV) {
    console.log('event', NAV[e.keyCode])
    navi = NAV[e.keyCode]

    if (navi.act === 'zoom') {
      if (
        (navi.dir === -1 && _VB[2] >= DMAX[0]) ||
        (navi.dir === 1 && _VB[2] <= WMIN)
      ) {
        console.log(`cannot zoom ${navi.name} animore`)
        return
      }

      for (let i = 0; i < 2; i++) {
        tg[i + 2] = _VB[i + 2] / Math.pow(2, navi.dir)
        tg[i] = 0.5 * (DMAX[i] - tg[i + 2])
      }

      // console.log('target', tg)
    }
    else if (navi.act === 'move') {
      if ((navi.dir === -1 && _VB[navi.axis] <= 0) || (navi.dir === 1 && _VB[navi.axis] >= DMAX[navi.axis] - _VB[navi.axis + 2])) {
        console.log(`cannot move ${navi.name} animore`)
        return
      }

      tg[navi.axis] = _VB[navi.axis] + 0.5 * navi.dir * _VB[navi.axis + 2]
      // console.log('target', tg)
    }

    // update()
  }
}

</script>

